<html>
<head>
<script language="javascript">
var IMAGES = ["img1", "img2", "img3", "img4"];
var COLOR_CHOSEN = false;

function clear_all_imgs()
{
	for (i = 0; i < IMAGES.length; i++)
	{
		document.getElementById(IMAGES[i]).style.display = "none";
	}
}

function randomize()
{
	if (COLOR_CHOSEN === false)
	{
		var last_index = 0;
		for (i = 0; i < 8; i++)
		{
			setTimeout(function()
			{
				clear_all_imgs();
				var random_index = Math.floor(Math.random() * IMAGES.length);
				while (random_index === last_index)
				{
					random_index = Math.floor(Math.random() * IMAGES.length);
				}
				document.getElementById(IMAGES[random_index]).style.display = "inline";
				last_index = random_index;
			}, i*500);
		}
		COLOR_CHOSEN = true;
	}
	else
	{
		clear_all_imgs();
		COLOR_CHOSEN = false;
	}
}
</script>
</head>
